tables.table_schema:
CREATE TABLE mood_data (
  session_id UUID,
  mood_type VARCHAR(50),
  mood_intensity INT,
  recorded_at TIMESTAMP
);

CREATE TABLE behavior_data (
  session_id UUID,
  behavior_type VARCHAR(50),
  behavior_description TEXT,
  observed_at TIMESTAMP
);

CREATE TABLE BehaviorAnalysis (
  analysis_id INT PRIMARY KEY,
  session_id INT,
  behavior_pattern TEXT,
  behavior_timestamp TIMESTAMP
);

CREATE TABLE PatientProfile (
  patient_id INT PRIMARY KEY,
  patient_name TEXT,
  patient_age INT,
  patient_gender TEXT
);

CREATE TABLE SessionFeedback (session_id UUID PRIMARY KEY,
 feedback_text TEXT,
 rating INT);

CREATE TABLE TherapyType (therapy_id UUID PRIMARY KEY,
 therapy_name VARCHAR,
 duration INT);
